add_filter( 'woocommerce_add_to_cart_validation', 'astra_remove_product_on_zero_quantity', 10, 3 );
function astra_remove_product_on_zero_quantity( $passed, $product_id, $quantity ) {
    $cart = WC()->cart;
    
    // Loop through cart items
    foreach( $cart->get_cart() as $cart_item_key => $cart_item ) {
        // Check if quantity is zero
        if( $cart_item['quantity'] == 0 ) {
            // Remove item from the cart
            $cart->remove_cart_item( $cart_item_key );
        }
    }
    
    return $passed;
}

#[tokio::main]
async fn main() {
    #[derive(Clone)]
    pub struct LogLayer {
        target: &'static str,
    }

    impl<S> tower::Layer<S> for LogLayer {
        type Service = LogService<S>;

        fn layer(&self, service: S) -> Self::Service {
            LogService {
                target: self.target,
                service,
            }
        }
    }

    // This service implements the Log behavior
    #[derive(Clone)]
    pub struct LogService<S> {
        target: &'static str,
        service: S,
    }

    impl<S, Request> tower::Service<Request> for LogService<S>
    where
        S: tower::Service<Request, Response = axum::response::Response> + Send + 'static,
        Request: std::fmt::Debug,
        S::Future: Send + 'static,
    {
        type Response = S::Response;
        type Error = S::Error;
        // `BoxFuture` is a type alias for `Pin<Box<dyn Future + Send + 'a>>`
        type Future = futures::future::BoxFuture<'static, Result<Self::Response, Self::Error>>;

        fn poll_ready(
            &mut self,
            cx: &mut futures::task::Context<'_>,
        ) -> futures::task::Poll<Result<(), Self::Error>> {
            self.service.poll_ready(cx)
        }

        fn call(&mut self, request: Request) -> Self::Future {
            // Insert log statement here or other functionality
            println!("request = {:?}, target = {:?}", request, self.target);
            println!("\n\nINCOMING\n\n");
            let future = self.service.call(request);
            Box::pin(async move {
                let response = future.await;
                // println!("request = {:?}, target = {:?}", response, self.target);
                println!("\n\nOUTGOING\n\n");
                response
            })
        }
    }
    let app = axum::Router::new()
        .route("/", axum::routing::get(handler))
        .layer(LogLayer { target: "hello" });

    // Use `hyper::server::Server` which is re-exported through `axum::Server` to serve the app.
    axum::Server::bind(&std::net::SocketAddr::from(([0, 0, 0, 0], 3001)))
        // Hyper server takes a make service.
        .serve(app.into_make_service())
        .await
        .unwrap();
}

async fn handler() -> &'static str {
    std::thread::sleep(std::time::Duration::from_secs(3));
    return "Was lauft bro? :D";
}

package com.arijulianto.hutang

import android.content.Intent
import androidx.appcompat.app.AppCompatActivity
import android.os.Bundle
import android.os.Handler
import android.widget.Toast
import androidx.recyclerview.widget.LinearLayoutManager
import com.arijulianto.hutang.databinding.ChoosePengutangBinding
import retrofit2.Call
import retrofit2.Callback
import retrofit2.Response

class ChoosePengutang : AppCompatActivity() {
    private lateinit var binding: ChoosePengutangBinding
    private var listData = mutableListOf<Pengutang>()
    private lateinit var adapter: AdapterPengutangChooser
    private lateinit var apiInterface: ApiInterface

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        binding = ChoosePengutangBinding.inflate(layoutInflater)
        val view = binding.root
        setContentView(view)

        supportActionBar?.hide()

        apiInterface = ApiClient.getApiClient().create(ApiInterface::class.java)
        loadData()
        Handler().postDelayed({
            initView()
        }, 1000)
    }

    private fun loadData(){
        apiInterface.listPengutang().enqueue(object: Callback<ApiResponsePengutang?> {
            override fun onResponse(
                call: Call<ApiResponsePengutang?>,
                response: Response<ApiResponsePengutang?>
            ) {
                response.body()?.data?.let { rows ->
                    listData = rows.toMutableList()
                    //adapter.updateData(listData)
                }
            }

            override fun onFailure(call: Call<ApiResponsePengutang?>, t: Throwable) {
                Toast.makeText(baseContext, t.message.toString(), Toast.LENGTH_SHORT).show()
            }
        })
    }

    private fun initView(){
        with(binding){
            adapter = AdapterPengutangChooser { data ->
                val intent = Intent()
                intent.putExtra("user", data)
                //startActivity(intent)
                setResult(RESULT_OK, intent)
                finish()
            }
            lvData.layoutManager = LinearLayoutManager(baseContext)
            lvData.adapter = adapter
            adapter.updateData(listData)
        }
    }
}

package com.arijulianto.hutang

import android.app.DatePickerDialog
import android.content.Intent
import android.graphics.drawable.ColorDrawable
import android.os.Bundle
import android.text.Editable
import android.text.TextWatcher
import android.widget.CompoundButton
import android.widget.Toast
import androidx.activity.result.contract.ActivityResultContracts
import androidx.appcompat.app.AppCompatActivity
import com.arijulianto.hutang.databinding.PiutangInputBinding
import kotlinx.coroutines.Dispatchers
import kotlinx.coroutines.runBlocking
import kotlinx.coroutines.withContext
import java.text.DecimalFormat
import java.text.DecimalFormatSymbols
import java.util.Calendar
import java.util.Locale


class PiutangInputActivity : AppCompatActivity() {
    private lateinit var binding:PiutangInputBinding
    lateinit var dataAdapter: AdapterPiutang

    var dataModel: PengutangData? = null

    private var appDb: AppDatabase? = null

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)

        binding = PiutangInputBinding.inflate(layoutInflater)
        val view = binding.root
        setContentView(view)

        supportActionBar?.setTitle("Input Piutang")
        supportActionBar?.setDisplayHomeAsUpEnabled(true)
        supportActionBar?.setBackgroundDrawable(ColorDrawable(getColor(R.color.primaryColorBlue)))
        supportActionBar?.setLogo(R.drawable.ic_back)
        supportActionBar?.setDisplayUseLogoEnabled(true)

        appDb = AppDatabase.getDatabase(this)
        var txtError = ""


        with(binding){

            rbWanita.setOnCheckedChangeListener(radioListener)
            rbPria.setOnCheckedChangeListener(radioListener)

            txtNama.setOnClickListener {
                val intent = Intent(baseContext,ChoosePengutang::class.java)
                startActivity(intent)
            }
            txtTanggal.setOnClickListener {
                val c = Calendar.getInstance()
                var v = txtTanggal.text.toString();

                var year = c.get(Calendar.YEAR)
                var month = c.get(Calendar.MONTH)
                var day = c.get(Calendar.DAY_OF_MONTH)

                val datePickerDialog = DatePickerDialog(
                    this@PiutangInputActivity,
                    { _, sYear, sMonth, sDay ->
                        val dat = String.format("%d-%02d-%02d", sYear, (sMonth + 1), sDay)
                        txtTanggal.setText(dat)
                    },
                    year,
                    month,
                    day
                )
                if(v.length==10){
                    var ev = v.split("-")
                    datePickerDialog.updateDate(ev[0].toInt(), (ev[1].toInt()-1), ev[2].toInt())
                }
                datePickerDialog.show()
            }

            txtJumlah.addTextChangedListener(object : TextWatcher {
                override fun beforeTextChanged(s: CharSequence, start: Int, count: Int, after: Int) {}
                override fun onTextChanged(s: CharSequence, start: Int, before: Int, count: Int) {
                    var input = s.toString()
                    if (!input.isEmpty()) {
                        input = input.replace(",", "")
                        input = input.replace(".", "")
                        val format = DecimalFormat("#,###,###")
                        var formatted: String = format.format(input.toDouble()).replace(",", ".")
                        txtJumlah.removeTextChangedListener(this)
                        txtJumlah.setText(formatted)
                        txtJumlah.setSelection(formatted.length)
                        txtJumlah.addTextChangedListener(this)
                    }
                }
                override fun afterTextChanged(s: Editable) {}
            })

            btnSimpan.setOnClickListener{
                var ok = false;
                /** Validate Input **/
                // validate Nama
                if(txtNama.text.toString().isEmpty()){
                    //txtNama.error = "Wajib diisi"
                    txtNama.requestFocus()
                    txtError = "Nama harus diisi"
                    //return@setOnClickListener
                }
                // validate Gender
                else if(!rbWanita.isChecked && !rbPria.isChecked){
                    txtError = "Silahkan pilih Jenis Kelamin!"
                    //return@setOnClickListener
                }
                // validate Tanggal
                else if(txtTanggal.text.toString().isEmpty()){
                    //txtTanggal.error = "Pilih Tanggal"
                    txtError = "Silahkan pilih Tanggal!"
                    //return@setOnClickListener
                }
                // validate Jenis
                else if(optHutang.selectedItem.toString() == "Pilih Satu"){
                    //val errHutang = optHutang.selectedView as TextView
                    //errHutang.error = "Silahkan Pilih Satu"
                    txtError = "Silahkan pilih Jenis Hutang!"
                    optHutang.requestFocus()
                    //return@setOnClickListener
                }
                // validate Jumlah
                else if(txtJumlah.text.toString().isEmpty()){
                    //txtJumlah.error = "Wajib diisi"
                    txtError = "Silahkan input Jumlah Hutang!"
                    txtJumlah.requestFocus()
                    //return@setOnClickListener
                }else{
                    txtError = "Data berhasil disimpan";
                    ok = true
                }

                var dataPiutang = Piutang(
                        nama = txtNama.text.toString(),
                        gender = if(rbWanita.isChecked) "Perempuan" else "Laki-laki",
                        tanggal = txtTanggal.text.toString(),
                        jenis = optHutang.selectedItem.toString(),
                        jumlah = txtJumlah.text.toString(),
                        keterangan = txtKeterangan.text.toString(),
                )

                /** Display Result **/
                // display Result
                if(txtError!="") {
                    Toast.makeText(
                        this@PiutangInputActivity,
                        txtError,
                        Toast.LENGTH_LONG
                    ).show()
                }
                if(ok){
                    //txtResult.setText(String.format(java.util.Locale.GERMANY, "%,d", txtJumlah.replace(".","").toLong()))
                    // Tampil ke text (v1)
                    /*var result = "Nama Lengkap : ${txtNama.text}"
                    result += "\nJenis Kelamin : ${if(rbWanita.isChecked) "Perempuan" else "Laki-laki"}"
                    result += "\nTanggal : ${txtTanggal.text}"
                    result += "\nJenis Hutang : ${optHutang.selectedItem }"
                    result += "\nJumlah : ${txtJumlah.text }"

                    txtResult.text = result*/

                    // tampil ke intent (v2)
                    /*val intent = Intent(baseContext,PiutangViewActivity::class.java)
                    intent.putExtra("data", dataPiutang)
                    startActivity(intent)*/

                    // tampil ke list view (v3)
                    /*listData.add(dataPiutang)
                    dataAdapter.updateData(listData)*/

                    // simpan ke database (v4)
                    runBlocking {
                        withContext(Dispatchers.IO) {
                            appDb?.piutangDao()?.insert(dataPiutang)
                        }
                    }
                    finish()
                }
            }
        }

        val intentData = intent.extras
        if(intentData != null){
            val user : PengutangData = intentData.getParcelable("user") ?: PengutangData()
            bindData(user)
        }
    }

    val startForResult = registerForActivityResult(ActivityResultContracts.StartActivityForResult()){ result ->
        if(result.resultCode == RESULT_OK){
            val bundle = result.data
            val user : PengutangData = bundle?.getParcelableExtra("user") ?: PengutangData()
            bindData(user)
        }
    }

    fun bindData(data: PengutangData){
        with(binding){
            txtIdUser.setText(dataModel?.iduser.toString())
            txtNama.setText(data?.nama)
            if (data?.gender == "L") {
                rbPria.isChecked = true
            } else if (data?.gender == "P") {
                rbWanita.isChecked = true
            }

        }
    }


    private val radioListener = CompoundButton.OnCheckedChangeListener{ rb, isChecked ->
        if(isChecked){
            if(rb.id == R.id.rbWanita){
                binding.rbPria.isChecked = false
            }else if(rb.id == R.id.rbPria){
                binding.rbWanita.isChecked = false
            }
        }
    }



}

/**
     * @api {post} /pos/upload-protocols PosUploadProtocols
     * @apiVersion 0.1.0
     * @apiName PosUploadProtocols
     * @apiGroup Pos
     * @apiHeader {String} Accept application/json
     *
     * @apiDescription Umożliwia wgranie protokołu
     * @apiParam {number} posId
     * @apiParam {number} posSfid
     * @apiParam {file} file
     * 
     * @apiSuccessExample {json} Success-Response:
     *     HTTP/1.1 200 OK
     *     {
     *          "success": true
     *     }
     */
    public function actionUploadProtocols()
    {
        $user = Yii::$app->user->identity;
        if (!$user) {
            throw new \yii\web\HttpException(401);
        }

        $request = Yii::$app->request;
        $posSfid = $request->post('posSfid');
        $posId = $request->post('posId');
        $file = UploadedFile::getInstanceByName('file');

        if (empty($file)) {
            throw new \yii\web\HttpException(400, 'Brak wymaganych parametrów');
        }

        // $baseUrl = '/home/isensor/domains/panel.isensor.pl/public_html/';
        // $path = $baseUrl. 'documentation/'. $posSfid;
        $path = 'documentation/' . $posSfid . '/dokument';
        if (!file_exists($path)) {
            FileHelper::createDirectory($path);
        }

        $file->saveAs($path . '/' . $file->baseName . '.' . $file->extension);

        /**
         * Wyciągnięcie protokołu z systemu plików
         */
        $protocols = [];
        if (file_exists($path)) {
            $files = FileHelper::findFiles($path);
            if ($files) {
                foreach ($files as $file) {
                    $protocolDate = date('Y-m-d H:i:s', filemtime($file));
                    $protocols[] = [
                        'protocol' => $file,
                        'date' => $protocolDate
                    ];
                }
            }
        }

        // Aktualizacja informacji o ilości protokołów
        $model = Aps::findOne($posId);
        $model->protocol = count($files);
        $model->save(false);

        return [
            'success' => true,
            'protocols' => $protocols
        ];
    }

    /**
     * @api {post} /pos/upload-documentation PosUploadDocumentation
     * @apiVersion 0.1.0
     * @apiName PosUploadDocumentation
     * @apiGroup Pos
     * @apiHeader {String} Accept application/json
     *
     * @apiDescription Umożliwia wgranie dokumentacji zdjęciowej
     * @apiParam {number} posId
     * @apiParam {number} posSfid
     * @apiParam {number} sensorIp
     * @apiParam {file} file
     * 
     * @apiSuccessExample {json} Success-Response:
     *     HTTP/1.1 200 OK
     *     {
     *          "success": true
     *     }
     */
    public function actionUploadDocumentation()
    {
        $user = Yii::$app->user->identity;
        if (!$user) {
            throw new \yii\web\HttpException(401);
        }

        $request = Yii::$app->request;
        $posSfid = $request->post('posSfid');
        $posId = $request->post('posId');
        $sensorIp = $request->post('sensorIp');
        $file = UploadedFile::getInstanceByName('file');

        if (empty($file)) {
            throw new \yii\web\HttpException(400, 'Brak wymaganych parametrów');
        }

        $path = 'documentation/' . $posSfid;
        if (!file_exists($path . '/' . $sensorIp)) {
            FileHelper::createDirectory($path . '/' . $sensorIp);
        }

        $file->saveAs($path . '/' . $sensorIp . '/' . $file->baseName . '.' . $file->extension);


        // Sensory
        $sql = "SELECT ip 
                FROM `sensor_aps` sa 
                JOIN sensor s ON sa.sensor_idsensor = s.idsensor 
                WHERE sa.aps_idaps = :id";
        $sensors = Yii::$app->db->createCommand($sql)
            ->bindValue(':id', $posId)
            ->queryAll();

        /**
         * Wyciągnięcie dokumentacji zdjęciowej z systemu plików
         */
        $imageDocumentation = [];
        $documentation = 0;
        foreach ($sensors as $sensor) {
            $images = [];
            if (file_exists($path . '/' . $sensor['ip'])) {
                $files = FileHelper::findFiles($path . '/' . $sensor['ip']);
                if ($files) {
                    foreach ($files as $file) {
                        $images[] = $file;
                    }
                    $imageDocumentation[] = [
                        'ip' => $sensor['ip'],
                        'images' => $images
                    ];
                    $documentation++;
                }
            }
        }

        // Aktualizacja informacji o ilości protokołów
        $model = Aps::findOne($posId);
        $model->documentation = $documentation;
        $model->save(false);

        return [
            'success' => true,
            'images' => $imageDocumentation
        ];
    }

    /**
     * @api {post} /pos/delete-protocol PosDeleteProtocol
     * @apiVersion 0.1.0
     * @apiName PosDeleteProtocol
     * @apiGroup Pos
     * @apiHeader {String} Accept application/json
     *
     * @apiDescription Umożliwia usunięcie protokołu
     * @apiParam {number} posId
     * @apiParam {number} posSfid
     * @apiParam {string} protocolPath
     * 
     * @apiSuccessExample {json} Success-Response:
     *     HTTP/1.1 200 OK
     *     {
     *          "success": true
     *     }
     */
    public function actionDeleteProtocol()
    {
        $user = Yii::$app->user->identity;
        if (!$user) {
            throw new \yii\web\HttpException(401);
        }

        $request = Yii::$app->request;
        $protocolPath = $request->post('protocolPath');
        $posSfid = $request->post('posSfid');
        $posId = $request->post('posId');

        if (!$protocolPath || !$posId || !$posSfid) {
            throw new \yii\web\HttpException(400, 'Brak wymaganych parametrów');
        }

        if (file_exists($protocolPath)) {
            FileHelper::unlink($protocolPath);
        }

        /**
         * Wyliczenie aktualnej ilości protokołów
         */
        $path = 'documentation/' . $posSfid . '/dokument';
        if (file_exists($path)) {
            $files = FileHelper::findFiles($path);
        }

        // Aktualizacja informacji o ilości protokołów
        $model = Aps::findOne($posId);
        $model->protocol = count($files);
        $model->save(false);

        return [
            'success' => true,
        ];
    }

    /**
     * @api {post} /pos/delete-documentation PosDeleteDocumentation
     * @apiVersion 0.1.0
     * @apiName PosDeleteDocumentation
     * @apiGroup Pos
     * @apiHeader {String} Accept application/json
     *
     * @apiDescription Umożliwia usunięcie dokumentacji zdjęciowej
     * @apiParam {number} posId
     * @apiParam {number} posSfid
     * @apiParam {number} sensorIp
     * 
     * @apiSuccessExample {json} Success-Response:
     *     HTTP/1.1 200 OK
     *     {
     *          "success": true
     *     }
     */
    public function actionDeleteDocumentation()
    {
        $user = Yii::$app->user->identity;
        if (!$user) {
            throw new \yii\web\HttpException(401);
        }

        $request = Yii::$app->request;
        $posId = $request->post('posId');
        $posSfid = $request->post('posSfid');
        $sensorIp = $request->post('sensorIp');

        if (!$sensorIp || !$posId || !$posSfid) {
            throw new \yii\web\HttpException(400, 'Brak wymaganych parametrów');
        }

        $path = 'documentation/' . $posSfid . '/' . $sensorIp;
        if (file_exists($path)) {

            $files = FileHelper::findFiles($path);
            if ($files) {
                foreach ($files as $file) {
                    FileHelper::unlink($file);
                }
                rmdir($path);
                // Aktualizacja informacji o ilości liczników z dokumentacją
                $model = Aps::findOne($posId);
                $model->documentation -= 1;
                $model->save(false);
            }
        }

        return [
            'success' => true,
        ];
    }

#include <algorithm>
#include <iostream>
#include <array>
#include <vector>
#include <numeric>
#include <random>
#include <chrono>


using namespace std;

#define int long long
#pragma comment(linker,"/STACK:1000000000,1000000000")

const long long INF = 1e9 + 7;
const int MAXN = 2e5 + 1000;
const int N = 1e5 + 10;

const int M1 = 1e9 + 123;
const int M2 = 1e9 + 321;
int P1 = 22811;
int P2 = 22699;
array<int, MAXN> power1, power2;

void init_pow() {
    power1[0] = 1;
    power2[0] = 1;
    for (int i = 1; i < MAXN; ++i) {
        power1[i] = (power1[i - 1] * P1) % M1;
        power2[i] = (power2[i - 1] * P2) % M2;
    }
}

void build_hash(string& s, vector<pair<int, int>>& h) {
    int n = s.size();
    h.resize(n + 1);
    h[0].first = 0;
    h[0].second = 0;

    for (int i = 0; i < n; ++i) {
        h[i + 1].first = (h[i].first + s[i] * power1[i]) % M1;
        h[i + 1].second = (h[i].second + s[i] * power2[i]) % M2;
    }
}

pair<int, int> get_hash(vector<pair<int, int>>& h, int pos, int len, int mx_pow = 0) {
    int h1 = h[pos + len].first - h[pos].first;
    int h2 = h[pos + len].second - h[pos].second;
    if (h1 < 0) {
        h1 += M1;
    }
    if (h2 < 0) {
        h2 += M2;
    }
    if (mx_pow != 0) {
        h1 = h1 * power1[mx_pow - (pos + len - 1)] % M1;
        h2 = h2 * power2[mx_pow - (pos + len - 1)] % M2;
    }
    return make_pair(h1, h2);
}

bool is_equal(vector<pair<int, int>>& h_l, vector<pair<int, int>>& h_r, int start1, int start2, int len) {
    pair<int, int> d_l, d_r;
    d_l.first = ((h_l[start1 + len].first - h_l[start1].first + M1) % M1 * power1[start2]) % M1;
    d_l.second = ((h_l[start1 + len].second - h_l[start1].second + M2) % M2 * power2[start2]) % M2;

    d_r.first = ((h_r[start2 + len].first - h_r[start2].first + M1) % M1 * power1[start1]) % M1;
    d_r.second = ((h_r[start2 + len].second - h_r[start2].second + M2) % M2 * power2[start1]) % M2;

    return d_l == d_r;
}

int random_key(const int before, const int after) {
    auto seed = std::chrono::high_resolution_clock::now().time_since_epoch().count();
    std::mt19937 mt_rand(seed);
    int base = std::uniform_int_distribution<int>(before + 1, after)(mt_rand);
    return base;
}

signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.tie(nullptr);

    P1 = random_key(256, M1);
    P2 = random_key(256, M2);

    string a, b;
    cin >> a >> b;
    int n = a.size(), m = b.size();
    b = b + b;
    int mx_pow = max(a.size(), b.size());

    vector<pair<int, int>> h_a, h_b;
    init_pow();
    build_hash(a, h_a);
    build_hash(b, h_b);

    vector<pair<int, int>> hashes;
    for (int i = 0; i < m; ++i) {
        hashes.emplace_back(get_hash(h_b, i, m, mx_pow));
    }

    stable_sort(hashes.begin(), hashes.end());

    int ans = 0;
    for (int i = 0; i + m <= n; ++i) {
        if (binary_search(hashes.begin(), hashes.end(), get_hash(h_a, i, m, mx_pow))) {
            ++ans;
        }
    }

    cout << ans << '\n';
}

