const loadMessages = async (id) => {
    let chat
    const data = await loadData()
    data.users.forEach(user => {
        if (user.id === id) {
            chat = user
        }
    })
    loadUserInfo(chat)
    messagesDiv.innerHTML = ''
    index = 0
    chat.messages.forEach(message => {
        let messageFullDate = new Date(message.sendDate)
        let messageOnlyDate = new Date(message.sendDate)
        let nextMessageOnlyDate
        let nextMessageFullDate
        if (chat.messages[index + 1]) {
            nextMessageFullDate = new Date(chat.messages[index + 1].sendDate)
            nextMessageOnlyDate = new Date(chat.messages[index + 1].sendDate)
            nextMessageOnlyDate.setHours(0)
            nextMessageOnlyDate.setMinutes(0)
            nextMessageOnlyDate.setSeconds(0)
        }
        messageOnlyDate.setHours(0)
        messageOnlyDate.setMinutes(0)
        messageOnlyDate.setSeconds(0)

        if (index === 0) {
            createMessageTimeStampElement(messageFullDate)
        }

        createMessageElement(message.message, message.sendBySelf, message.sendDate)
        if (messageOnlyDate < nextMessageOnlyDate) {
            createMessageTimeStampElement(nextMessageFullDate)
        }
        index++
    })
}

const loadChat = async () => {
    const data = await loadData()
    let firstChat = true
    await data.users.forEach(chat => {
        const lastMessage = chat.messages[chat.messages.length - 1]
        const lastMessageDate = new Date(lastMessage.sendDate)
        let unreadMessages = 0
        for (let message of chat.messages) {
            if (message.viewed === false) {
                unreadMessages++
            }
        }
        createChatElement(chat.id, chat.name, lastMessage.message, `${lastMessageDate.getHours()}:${lastMessageDate.getMinutes()}`, unreadMessages, firstChat, chat.avatar)
        firstChat = false
    })

    const chatsElements = document.querySelectorAll('.patient')

    chatsElements.forEach(chat => {
        chat.addEventListener('click', () => {
            loadMessages(chat.id)
            // loadChat()
        })
    })

    return true
}


