    int l = 0, r = n + 1;
    vector<pair<int, int>> segs;
    int ans_pos;
    while (r - l > 1) {
        int mid = (r + l) / 2;

        segs.clear();
        for (int i = 0; i + mid <= n; ++i) {
            segs.emplace_back(get_hash(h_a, i, mid, n));
        }

        int pos = -1;
        sort(segs.begin(), segs.end());
        for (int i = 0; i + mid <= n; ++i) {
            if (binary_search(segs.begin(), segs.end(), get_hash(h_b, i, mid, n))) {
                pos = i;
                break;
            }
        }

        if (pos >= 0) {
