class Solution {
public:
    long long int M = 972663749, p = 31;
    vector<long long> po;
    vector<long long> hs;
    long long total = 0;
    int n;
    void calculateHash(string&s){
        po[0] = 1;
        for(int i=1;i<n;i++){
            po[i] = (po[i-1]*p)%M;
        }
        hs[0] = s[0]-'a'+1;
        for(int i=1;i<n;i++){
            hs[i] = (hs[i-1] + (po[i]*s[i]-'a'+1)%M)%M;
        }
    }

    bool compareSubstring(int l1, int r1, int l2, int r2){
        long long hash1 = hs[r1];
        if(l1 > 0) hash1 = (hash1 - hs[l1-1] + M)%M;
        long long hash2 = hs[r2];
        if(l2 > 0) hash2 = (hash2 - hs[l2-1] + M)%M;
        hash1 = (hash1*po[l2-l1])%M;
        return hash1 == hash2;
    }

    long long sumScores(string s) {
        po.resize(100005);
        hs.resize(100005);
        n = s.size();
        calculateHash(s);
        cout << compareSubstring(0, 0, 4, 4) << endl;

        for(int i=1;i<=s.size();i++){
            long long lo = 0, hi = i+1, mid;
            while(lo <= hi){
                mid = (lo + hi)/2;
                if(compareSubstring(0, mid-1, n-i, n-i+mid-1)){
                    lo = mid;
                }
                else hi = mid;
            }
            total += lo;
        }
        return total;
    }
};

